import React, { useEffect } from 'react'
import axios from 'axios'

const PostData =({phoneObject})=>{

    useEffect(()=>{
        axios.post('http://localhost:3001/persons',phoneObject)
        .then(response=>{
            console.log(response)
        })
    },[phoneObject])
}

export default PostData
